declare var FontFace: any;

let nonBoldEgyptFace = new FontFace(
    "Guardian Text Egyptian Web",
    `url(data:application/font-woff;base64,) format("woff")`
);

let egyptianFace = new FontFace(
    "Guardian Text Egyptian Web",
    `url(data:application/font-woff;base64,) format("woff")`,
    {
        weight: "700"
    }
);

let sansFace = new FontFace(
    "Guardian Sans Web",
    `url(data:font/woff;charset=utf-8;base64,) format("woff")`
);

export const fontsLoaded = Promise.all([nonBoldEgyptFace.load(), egyptianFace.load(), sansFace.load()]).then(
    fonts => {
        fonts.forEach(font => (document as any).fonts.add(font));
    }
);
